import React from 'react';
import CoursePlannerForm from './components/CoursePlannerForm';
import axios from 'axios';

const App = () => {
  const onGenerateSchedule = async (careerAspiration, creditsPerQuarter) => {
    try {
      const response = await axios.post('http://localhost:5000/api/generate-schedule', {
        careerAspiration,
        creditsPerQuarter,
      });
      console.log('Generated Schedule:', response.data);
      // You can add logic to display the generated schedule
    } catch (error) {
      console.error('Failed to generate schedule', error);
    }
  };

  return (
    <div className="App">
      <h1>Auto Course Planner</h1>
      <CoursePlannerForm onGenerateSchedule={onGenerateSchedule} />
      {/* Add more components to display generated schedule */}
    </div>
  );
};

export default App;
